import React, {Component} from 'react';
import {Redirect } from 'react-router-dom';

class Debits extends Component{
    constructor(props){
        super(props)
        // this.state ={

        // }
    }

    formatDebits = () => {
        let allDebits = this.props.allDebits;
        let newData = [];
        for (let i = 0; i < allDebits.length; i++) {
            newData.push(allDebits[i]);
            newData.push(", ");
        }
        newData.pop();

    }

    render(){
        return(
            <div>
                <h1>Debits</h1>
                <h7>{this.props.allDebits.join(", ")}</h7>
            </div>
        );
    }
}

export default Debits;
